      //     </Grid>
      //   </Toolbar>
      // </AppBar>*/}
    	<EmotionSlider
  			style={classes}
  			title='1. Little interest or pleasure in doing things'
  		/>
    </Paper>
  );
}

Emotions.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(Emotions);
